import React from 'react';
import './ModelDetails.css';

const ModelDetails = ({ model, onDeselect, onConfirm }) => {
  return (
    <div className="model-details">
      <h3>{model.name}</h3>
      <p>SKU: {model.sku}</p>
      <p>{model.description}</p>

      {model.additionalAttribute && Object.keys(model.additionalAttribute).length > 0 && (
        <div className="additional-attributes">
          <h4>Additional Attributes</h4>
          <ul>
            {Object.entries(model.additionalAttribute).map(([key, value]) => (
              <li key={key}>
                <strong>{key}:</strong> {value}
              </li>
            ))}
          </ul>
        </div>
      )}

      <button onClick={onDeselect} className="btn btn-secondary">Back</button>
      <button onClick={onConfirm} className="btn btn-primary">Next</button>
    </div>
  );
};

export default ModelDetails;
